const ListBuild = (props) => {
    const links = [
        {link:{linked:'https://lumbungkaos.com/'}},
    ]
    const BuildWith = [
        {
            data: [
                { no: 1, title: 'HTML' },
                { no: 2, title: 'Bootstrap' },
                { no: 3, title: 'Laravel' },
                { no: 4, title: 'MySQL' },
            ]
        }, {
            data: [
                { no: 1, title: 'HTML' },
                { no: 2, title: 'Bootstrap' },
            ]
        }, {
            data: [
                { no: 1, title: 'HTML' },
                { no: 2, title: 'Bootstrap' },
                { no: 3, title: 'PHP' },
                { no: 3, title: 'MySQL' },
            ]
        }, {
            data: [
                { no: 1, title: 'React JS' },
                { no: 2, title: 'Tailwind' },
            ]
        }
        
    ]
    return (
        <div>
            {
                BuildWith[props.noBuild].data.map((datas) => (
                    <div key={datas.no} className="flex pt-2 pl-3">
                        <div className="pt-[2px]">
                        <ion-icon name="checkmark-circle-outline"></ion-icon>
                        </div>
                        <div className="pl-2 text-md text-gray-400">{datas.title}</div>
                    </div>
                ))
            }
            <div className="text-center mt-4">
                <a href="https://lumbungkaos.com/" className="border-2 border-[#00BC9A] rounded-md px-8 py-2 hover:bg-[#00BC9A] hover:text-white transition-all duration-300">View</a>
            </div>
        </div>
    )
}
export default ListBuild
